eria"],"index":[0,14,44],"level":["D","D","D"],"name":["  Viruses","    Eukaryota","    Bacteria"],"new_est_reads":[883880,9569,1529],"percent":{"__ndarray__":"fPKwUGua7z8noImw4emFP18HzhlR2ls/","dtype":"float64","order":"little","shape":[3]},"tax_id":[10239,2759,2]},"selected":{"id":"14165"},"selection_policy":{"id":"14164"}},"id":"14089","type":"ColumnDataSource"},{"attributes":{"css_classes":["markdown"],"margin":[5,5,5,5],"name":"Kaiju and Kraken","sizing_mode":"stretch_width","text":"&amp;lt;h2&amp;gt;Kaiju and Kraken2&amp;lt;/h2&amp;gt;\n&amp;lt;p&amp;gt;Kaiju and Kraken2 are both programs for taxonomic classification of DNA sequences.\nThey both use a database of known genetic markers and a sequence alignment algorithm to compare a query sequence to the reference \nindex and score the alignments between the two&amp;lt;/p&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;Algorithms: Kaiju uses the MEGAN algorithm for taxonomic classification, while Kraken2 uses a custom algorithm called &amp;amp;ldquo;k-mer counting.&amp;amp;rdquo; \nThe specific algorithm used can affect the speed and accuracy of the classification.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Reference database: Kaiju and Kraken2 use different reference databases for taxonomic classification. \nKaiju uses a database called &amp;amp;ldquo;NINJA&amp;amp;rdquo; (Non-redundant Improved and Normalized Just-in-time Annotations), \nwhich includes annotations for a wide variety of organisms.\nKraken2 uses a database called &amp;amp;ldquo;Minikraken,&amp;amp;rdquo; \nwhich includes annotations for a more limited set of organisms but is more comprehensive for those organisms.&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;"},"id":"14153","type":"panel.models.markup.HTML"},{"attributes":{},"id":"14173","type":"Selection"},{"attributes":{"editor":{"id":"14111"},"field":"name","formatter":{"id":"14110"},"title":"name","width":0},"id":"14112","type":"TableColumn"},{"attributes":{"child":{"id":"14155"},"name":"MEGAHIT","titl
